function PopupWithForm(props) {
    return (
      <div className={`popup popup_type_${props.name} ${props.isOpen ? 'popup_open' : '' }`}>
        <div className="popup__container">
          <button className="popup__close" type="button" title="Закрыть окно" aria-label="Закрыть"></button>
          <form className="popup__form">
          <fieldset className="popup__fieldset">
            <legend className="popup__header">{props.title}</legend>
            {props.children}
            <button className="popup__button" type="submit">Создать</button>
          </fieldset>
        </form>
      </div>
    </div>
  )
}
export default PopupWithForm;
